import React from "react";

function Login()
{
    return(
        <form action = "/login" methdo ="post">
            <input type = "email" placeholder = "Email"></input>
            <input type = "password" placeholder = "Password"></input>
            <button type="submit">Login</button>
        </form>
    );
}

export default Login;
